B.zK=new A.c2("Das folgende Applet stellt den Kurzkanaleffekt mit Hilfe des B\xe4nderdiagramms dar. Die am Transistor anliegenden Spannungen sind vorgegeben; die Kanall\xe4nge kann eingestellt werden.\n\nMan sieht:\n",B.KE,"Englisch",B.V,null)
B.KH=A.a(s(["Je nach Typ (n oder p) sind freie Elektronen oder L\xf6cher in einem Halbleiter vorhanden.","Legt man eine Spannung U an die Struktur, so bewirkt dies ein elektrisches Feld E im Halbleiter.","Unter Einfluss des elektrisches Feldes E bewegen sich die freien Ladungstr\xe4ger in dem Halbleiter, was zu einem elektrischen Strom I f\xfchrt.","Je gr\xf6\xdfer die Spannung ist, desto so gr\xf6\xdfer ist das elektrische Feld und damit die Geschwindigkeit der Ladungstr\xe4ger, was eine Zunahme des Stromes bedeutet. Der Zusammenhang zwischen elektrischem Feld und der Ladungstr\xe4gergeschwindigkeit ist die so genannte Beweglichkeit."]),t.s)
B.zL=new A.c2("Dieses Applet verdeutlicht den Einfluss eines elektrischen Feldes auf freie Ladungstr\xe4ger in einem Halbleiter.\n\nMan sieht:\n",B.KH,"Englisch",B.V,null)
B.J0=A.a(s(["Ist im Valenzband eine L\xfccke (auch Defektelektron oder Loch genannt) entstanden, so k\xf6nnen benachbarte Elektronen in diese L\xfccke springen (obere Grafik), was einem Ladungstransport und damit einem Stromfluss entspricht.","Die Bewegung der nachr\xfcckenden Elektronen (hier: Bewegung negativer Ladung von rechts nach links) hat den gleichen Effekt wie eine sich in die andere Richtung (also von links nach rechts) bewegende positive Ladung (untere Grafik).","Ein fehlendes Elektron, d.h. allgemein ein Zustand, der nicht von einem Elektron besetzt ist, kann daher als ein eigenes Teilchen mit positiver Ladung, ein so genanntes Loch, betrachtet werden.","Neben der Anzahl der freien Elektronen im Leitungsband ist daher auch die Anzahl der freien L\xf6cher im Valenzband wesentlich f\xfcr die elektrischen Eigenschaften des Halbleiters verantwortlich, da beide Ladungstr\xe4gerarten zum Stromtransport beitragen k\xf6nnen."]),t.s)
B.zM=new A.c2('Bricht durch Zufuhr von Energie eine Bindung im undotierten Halbleiter auf, d.h. gelangt im B\xe4nderdiagramm ein Elektron vom Valenzband in das Leitungsband, so kann es sich frei bewegen und zum Ladungstransport beitragen. Doch auch die entstandene "L\xfccke" (das Loch) kann zum Ladungstransport beitragen, indem in diese L\xfccke ein anderes Elektronen nachr\xfcckt, welches daraufhin an einer anderen Stelle ein Loch hinterl\xe4sst. Das Loch "wandert" also gleichsam durch den Halbleiter. Das folgende Applet zeigt die zwei m\xf6glichen Betrachtungsweisen des Ladungstransports im Valenzband. Die obere Abbildung zeigt die Bewegung der Elektronen (Elektronenkonzept), die untere stellt den Vorgang durch die Bewegung der "L\xfccke" dar (L\xf6cherkonzept).\n\nMan sieht:\n',B.J0,"Englisch",B.V,null)
B.Jo=A.a(s(["Bei ausgeschaltetem Licht befinden sich in der Halbleiterprobe keine zus\xe4tzlichen Elektron-Loch Paare; die Tr\xe4gerdichten n, p entsprechen den Gleichgewichtsdichten n0, p0.","Nach dem Einschalten des Lichts erh\xf6ht sich durch die zugef\xfchrte Energie die Generationsrate, d.h. es werden zus\xe4tzliche Elektron-Loch Paare gebildet: Die Tr\xe4gerdichten n und p steigen um den jeweils gleichen Betrag an.","Da mit zunehmender Ladungstr\xe4gerdichte n, p auch die Rekombinationsrate R steigt (R ~ n*p), stellt sich nach einiger Zeit ein neuer Gleichgewichtszustand ein, in dem genauso viel Ladungstr\xe4gerpaare generiert werden wie durch Rekombination verschwinden.","Wird das Licht wieder ausgeschaltet, werden keine zus\xe4tzlichen Ladungstr\xe4ger mehr generiert und nach einiger Zeit wird der urspr\xfcngliche Gleichgewichtszustand (TGG) wieder erreicht.","Die Zeitkonstante, mit der der Ausgleichsvorgang erfolgt, ist die Lebensdauer der Minorit\xe4tstr\xe4ger."]),t.s)
B.zN=new A.c2("In einem Halbleiter werden bei Temperaturen T>0 st\xe4ndig Elektron-Loch Paare durch thermische Generation erzeugt; gleichzeitig rekombiniert die gleiche Anzahl von Elektron-Loch Paaren, so dass sich ein - temperaturabh\xe4ngiges - Gleichgewicht, das so genannte thermodynamische Gleichgewicht (TGG) einstellt. Durch Injektion zus\xe4tzlicher Ladungstr\xe4ger oder Lichteinstrahlung kann dieses Gleichgewicht jedoch gest\xf6rt werden.\n\nDieses Applet zeigt das Verhalten einer Halbleiterprobe bei einer St\xf6rung des TGGs durch Lichteinstrahlung und den anschlie\xdfenden Ausgleichsvorgang. Der Anschaulichkeit halber werden in dem Halbleiter nur die durch die Lichteinstrahlung zus\xe4tzlich generierten Ladungstr\xe4ger dargestellt.\n\nMan sieht:\n",B.Jo,"Englisch",B.V,null)
B.Kx=A.a(s(["Frei bewegliche Teilchen f\xfchren bei Temperaturen T>0K thermische Bewegungen aus, deren Betrag und Richtung statistisch verteilt sind.","Betrachtet man zun\xe4chst nur die linke Kammer, so ist in dieser die Teilchenkonzentration \xfcberall konstant. Im Mittel heben sich demnach die thermischen Bewegungen der Teilchen gegenseitig auf.","Wird die Trennung zwischen den Kammern entfernt, so entsteht an dieser Stelle ein sehr gro\xdfer Konzentrationsgradient dn/dx. In diesem Bereich heben sich die thermischen Bewegungen nicht mehr gegenseitig auf und es kommt zu einem Zerflie\xdfen des Teilchenhaufens, so lange, bis die Teilchenkonzentration wieder \xfcberall konstant ist.","Dieser Diffusionsvorgang durch thermische Bewegung ist unabh\xe4ngig von der Ladung der Teilchen. Handelt es sich jedoch um freie Elektronen oder L\xf6cher, so f\xfchrt die Diffusionsbewegung zu einem Diffusionsstrom. Dieser ist proportional dem Gradienten der Ladungstr\xe4gerverteilung dn/dx und der Temperatur T."]),t.s)
B.zO=new A.c2("Dieses Applet veranschaulicht den Vorgang der Diffusion.\n\nMan sieht:\n",B.Kx,"Englisch",B.V,null)
B.JD=A.a(s(["Durch Bestrahlung werden Ladungstr\xe4gerpaare im Innern des Bauelementes generiert, die zum Ladungstransport beitragen k\xf6nnen.","Eine Erh\xf6hung der Bestrahlungsst\xe4rke Ee f\xfchrt zu einem Anstieg der Generationsrate und somit zu einer h\xf6heren Anzahl freier Ladungstr\xe4ger, was wiederum eine Erh\xf6hung der Leitf\xe4higkeit bewirkt. Entsprechend sinkt die Leitf\xe4higkeit bei Verringerung der Bestrahlungsst\xe4rke.","Um die durch die Bestrahlung generierten Ladungstr\xe4ger im Innern des Bauelementes zu trennen und zu den Elektroden hin zu transportieren, ist ein elektrisches Feld E bzw. eine von au\xdfen angelegte Spannung U erforderlich.","Je h\xf6her diese Spannung U ist, desto gr\xf6\xdfer ist der Strom I durch den Fotowiderstand.","Der Strom I ist somit in guter N\xe4herung sowohl zu der Bestrahlungsst\xe4rke Ee als auch zu der angelegten Spannung U proportional, was zu der im Applet rechts gezeigten Widerstandsgeraden f\xfchrt, deren Steigung mit steigender Bestrahlungsst\xe4rke zunimmt.","Ohne Bestrahlung (Ee = 0) weist der Fotowiderstand eine von null verschiedene, geringe Leitf\xe4higkeit auf, d.h. bei einer angelegten Spannung flie\xdft ein geringer Dunkelstrom (der jedoch im linken Teil des Applets nicht animiert ist)."]),t.s)
B.zP=new A.c2("Dieses Applet veranschaulicht die Funktion eines Fotowiderstandes. Die linke Seite des Applets zeigt eine schematische Darstellung des Fotowiderstandes, wobei aus Gr\xfcnden der \xdcbersichtlichkeit nur die durch Bestrahlung generierten freien Ladungstr\xe4ger animiert werden. Die rechte Seite des Applets zeigt die Strom-Spannungs Kennlinie des Bauelementes, wobei der aktuelle Arbeitspunkt durch einen roten Punkt gekennzeichnet ist. Mit Hilfe der vier Schaltfl\xe4chen im unteren Bereich des Applets k\xf6nnen die Bestrahlungsst\xe4rke Ee sowie die angelegte Spannung U variiert werden.\n\nMan sieht:\n",B.JD,"Englisch",B.V,null)
B.I_=A.a(s(["Bei niedrigen Temperaturen (hier: 300K) ist das Atom in einem energetisch niedrigen Zustand. In dem dargestellten Atommodell befindet sich das Elektron auf der inneren Schale.","Durch Erh\xf6hen der Temperatur gelangt das Elektron auf eine weiter au\xdfen liegende Schale. Dies entspricht einem angeregten Energiezustand.","Tr\xe4gt man die m\xf6glichen Energiewerte W, die das Atom annehmen kann, in einem einfachen Diagramm auf, so ergeben sich mehrere diskrete Zust\xe4nde (Energielinien), deren Anzahl und Abst\xe4nde f\xfcr das Atom charakteristisch ist."]),t.s)
B.zQ=new A.c2("Atome k\xf6nnen unterschiedliche Energiezust\xe4nde annehmen. Dieses Applet zeigt in einer stark vereinfachten Darstellung einen Atomkern (rot) mit einem Valenzelektron (blau), welches durch Zuf\xfchren von W\xe4rmeenergie angeregt wird.\n\nMan sieht:\n",B.I_,"Englisch",B.V,null)
B.I0=A.a(s(["Bei einem einzigen Atom (n=1) erh\xe4lt man zwei m\xf6gliche Energiezust\xe4nde, von denen der untere besetzt ist.","Bei zwei Atomen (n=2) spalten sich die Energiezust\xe4nde wegen der Kopplung zwischen den beiden Atomen auf.","Erh\xf6ht man die Anzahl der Atome weiter, so spalten sich die Energieniveaus immer weiter auf, bis diese bei einer sehr gro\xdfen Anzahl von Atomen (hier n=16) so dicht beieinander liegen, dass man nicht mehr von Energielinien sondern von Energieb\xe4ndern spricht.","Da in diesem Beispiel eine sehr niedrige Umgebungstemperatur angenommen wurde, befinden sich alle Elektronen in dem jeweils niedrigsten Energiezustand, d.h. in dem unteren Energieband. Das obere Energieband ist unter diesen Bedingungen vollst\xe4ndig unbesetzt."]),t.s)
B.zR=new A.c2("Dieses Applet illustriert den \xdcbergang von einem einzelnen Atom zu einem Kristall mit einer sehr gro\xdfen Zahl von regelm\xe4\xdfig angeordneten Atomen, wobei der Abstand der Atome untereinander so gering ist, dass die Atome miteinander in Wechselwirkung stehen. Die Umgebungstemperatur sei in dem Beispiel sehr niedrig, so dass jeweils die untersten Energiezust\xe4nde besetzt sind.\n\nMan sieht:\n",B.I0,"Englisch",B.V,null)
B.JM=A.a(s(["Der Bipolartransistor besteht aus drei unterschiedlich dotierten Gebieten (Emitter, Basis und Kollektor). Im Fall des npn-Transistors sind der Emitter (E) und der Kollektor (C) n-dotiert, die Basis (B) ist p-dotiert, so dass man zwei hintereinandergeschaltete pn-\xdcberg\xe4nge erh\xe4lt."]),t.s)
B.zT=new A.Gj(null)
B.Kc=A.a(s(["Da allein die Null- und Polstellen der \xdcbertragungsfunktion die \xdcbertragungseigenschaften der Schaltung festlegen, gen\xfcgt es, deren Lage in der komplexen Ebene anzugeben, was durch Kreuze (x) f\xfcr Pole und Kreise (o) f\xfcr Nullstellen erfolgt. Die in diesem Beispiel gezeigte Schaltung weist also zwei Polstellen p1 und p2 und keine Nullstellen auf.","Durch \xc4nderung des Schaltungsparameters v \xe4ndert sich unmittelbar die \xdcbertragungsfunktion und damit auch die Lage der Polstellen in der komplexen Ebene wie im Bild oben links dargestellt.","Die Polstellenverteilung hat wiederum Einfluss auf den Frequenzgang |A(jw)| sowie den Phasengang phase(A(jw)) der Schaltung (Bild rechts oben bzw. unten).","Ebenso besteht ein wichtiger Zusammenhang zwischen der Lage der Polstellen und dem dynamischen Verhalten der Schaltung. Da jeder Pol s' der \xdcbertragungsfunktion A(s) einen Term der Form 1-exp(s' t) in der Sprungantwort liefert (Laplace-Transformation), bedeutet ein reeller Pol in der linken Halbebene der komplexen Frequenzebene (v<1) einen aperiodischen Anstieg der Sprungantwort auf deren Endwert (hier: v). Ein konjugiert komplexes Polpaar in der linken Halbebene (1<v<3) verursacht wegen der komplexen Exponentialfunktion einen periodischen Einschwingvorgang und f\xfcr ein rein komplexes Polpaar (v=3) ergibt sich schlie\xdflich eine unged\xe4mpfte Sinusschwingung.","Je n\xe4her die Pole der \xdcbertragungsfunktion in Richtung der imagin\xe4ren Achse wandern, um so eher neigt die Schaltung zum Schwingen. Dies zeigt sich au\xdfer in der Sprungantwort auch in dem Frequenzgang |A(jw)|, der bei der Schwingfrequenz eine ausgepr\xe4gte \xdcberh\xf6hung zeigt. Besonders kritisch ist Situation bei gegengekoppelten Verst\xe4rkerschaltungen, bei denen man der Stabilit\xe4t besonderes Augenmerk widmen muss."]),t.s)
B.zU=new A.c2("Dieses Applet zeigt f\xfcr eine konkrete Schaltung mit der \xdcbertragungsfunktion A(jw)=ua/ue beispielhaft den Einfluss eines der Schaltungsparameter auf die Lage der Polstellen und damit auf den Frequenzgang. Ebenso ist der Einfluss der Lage der Pole auf den Phasengang und auf die Sprungantwort dargestellt.\n\nMan sieht:\n",B.Kc,"Englisch",B.V,null)
B.K8=A.a(s(["Jedes der Siliziumatome hat vier Valenzen, die r\xe4umlich ausgerichtet sind, so dass sich benachbarte Atome bevorzugt in diesen Richtungen anlagern. Dadurch entsteht eine regelm\xe4\xdfige Struktur, das so genannte Kristallgitter."]),t.s)
B.zV=new A.c2("Das folgende Applet zeigt die dreidimensionale Struktur eines Siliziumkristalls, bestehend aus mehreren Siliziumatomen. Durch Ziehen mit der Maus kann der Kristall r\xe4umlich gedreht werden.\n\nMan sieht:\n",B.K8,"Englisch",B.V,null)
B.KQ=A.a(s(["Da im thermodynamischen Gleichgewicht die Fermienergie Wf (hier nicht dargestellt) im Bauelement \xfcberall auf dem gleichen Niveau liegt, ist die relative Lage der Valenz- und Leitungsbandkanten in den einzelnen Gebieten von den dortigen Dotierungen abh\xe4ngig (vgl. Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm). In den n-dotierten Source- und Draingebieten liegen die Bandkanten Wc und Wv demnach unterhalb denen im p-dotierten Bulk und es ergeben sich die im Diagramm dargestellten Potenzialverl\xe4ufe.","Damit Elektronen von der Source zur Drain wandern k\xf6nnen, m\xfcssen diese erst die unterhalb des Gates liegende Potenzialbarriere \xfcberwinden. Die H\xf6he der Barriere h\xe4ngt dabei insbesondere von den am Transistor anliegenden Spannungen ab:",'Durch Anlegen einer positiven Gatespannung (UGS>0) gegen\xfcber dem Bezugspotenzial (Source) verschiebt sich das Ferminiveau an der Gate-Elektrode nach unten und die Bandkanten Wc und Wv im Bulk unmittelbar unterhalb des Gate "verbiegen" sich (vgl.: B\xe4nderdiagramm einer MOS-Struktur). Dadurch verringert sich die Potenzialbarriere.',"Durch Anlegen einer negativen Bulkspannung (USB>0) gegen\xfcber dem Bezugspotenzial (Source) verschieben sich das dortige Ferminiveau und damit die Bandkanten Wc und Wv im Bereich des Bulk nach oben und die Potentialbarriere erh\xf6ht sich.","Ob ein Strom durch den Transistor flie\xdfen kann oder nicht, h\xe4ngt somit von der Lage der Bandkanten unmittelbar unterhalb des Gates (im Bereich des Kanals) ab. In den nachfolgenden Applets ist daher lediglich der Verlauf der Bandkanten entlang der y-Achse bei x=0 dargestellt."]),t.s)
B.zW=new A.c2("Das Applet zeigt den Verlauf des B\xe4nderdiagramms eines MOSFET \xfcber dem Querschnitt des Bauelementes. Es wird der Einfluss von Gate- und Substratspannung auf den Verlauf der Bandkanten Wc und Wv schematisch dargestellt. In dem Applet liegt der Source-Anschluss auf 0V (Bezugspotenzial).\n\nMan sieht:\n",B.KQ,"Englisch",B.V,null)
B.Jm=A.a(s(["Abh\xe4ngig von der Lage des Ferminiveaus handelt es sich um einen p- oder n-Typ Halbleiter mit entsprechender Konzentration der Ladungstr\xe4gerdichten (vgl. Darstellung der Tr\xe4gerdichten abh\xe4ngig von der Lage des Ferminiveaus).","Bei einer Spannung von U=0V liegt das Ferminiveau \xfcberall auf gleicher H\xf6he, der Halbleiter ist im thermodynamischen Gleichgewicht und es flie\xdft kein Strom durch den Halbleiter.","Das Anlegen einer elektrischen Spannung an den Halbleiter bewirkt eine Verschiebung der Bandkanten gem\xe4\xdf U=-W/q, so dass das Ferminiveau innerhalb des Halbleiters nicht mehr auf energetisch gleicher H\xf6he liegt, was einer St\xf6rung des thermodynamischen Gleichgewichts entspricht.",'Elektronen und L\xf6cher bewegen sich aufgrund ihrer Ladung und der Richtung des elektrischen Feldes zu den entsprechenden Polen der Spannungsquelle. In der B\xe4nderdiagrammdarstellung haben Elektronen stets das Bestreben, "nach unten" zu flie\xdfen, da dies einer Abnahme ihrer Energie entspricht; L\xf6cher streben entsprechend "nach oben". Bei geneigten Bandkanten stellt sich somit ein Ladungstr\xe4gertransport und damit ein Stromfluss I ein.',"Abh\xe4ngig von der Art und St\xe4rke der Dotierung (d.h. der Lage des Ferminiveaus relativ zu Wi) wird der Strom eher von Elektronen (n-Typ Halbleiter) oder von L\xf6chern (p-Typ Halbleiter) getragen."]),t.s)
B.zX=new A.c2("Das folgende Applet zeigt den Vorgang des Ladungstr\xe4gertransportes in einem Halbleiter mit Hilfe der B\xe4nderdiagrammdarstellung, abh\xe4ngig von der angelegten Spannung und der Lage des Ferminiveaus.\n\nMan sieht:\n",B.Jm,"Englisch",B.V,null)
B.KR=A.a(s(["Das Anlegen einer Drain-Source Spannung UDS f\xfchrt nur dann zu einem Strom IDS durch den Transistor, wenn die Gate-Source Spannung UGS gr\xf6\xdfer ist als die Einsatzspannung Uth,n, da sich erst dann ein leitender Kanal unter dem Gate bildet.","\xdcberschreitet die Gate-Source Spannung UGS die Einsatzspannung Uth,n, so bildet sich ein leitender Kanal unterhalb des Gates und es kann ein Strom flie\xdfen, wenn eine Spannung UDS angelegt wird.","Der Strom IDS steigt - bei konstantem UGS - zun\xe4chst mit gr\xf6\xdfer werdender Spannung UDS stark an. Diesen Bereich bezeichnet man als Widerstandsbereich.","Mit gr\xf6\xdfer werdender Spannung UDS erreicht der Strom jedoch einen S\xe4ttigungswert und steigt dann nur noch geringf\xfcgig an. Dieser Bereich wird als S\xe4ttigungsbereich bezeichnet."]),t.s)
B.zY=new A.Gk(null)
B.Jr=A.a(s(["F\xfcr die gezeigte Anordnung eines gegengekoppelten Verst\xe4rkers, bei dem ein Teil k des Ausgangssignals wieder mit umgekehrtem Vorzeichen auf den Eingang zur\xfcckgef\xfchrt wird, ergibt sich allgemein eine Gesamtverst\xe4rkung ua/ue von:"]),t.s)
B.zZ=new A.Gl(null)
B.Jp=A.a(s(["Bei negativen Spannungen zwischen Gate und Halbleitermaterial (UGB<0V) werden freie Ladungstr\xe4ger (L\xf6cher) aus dem p-dotierten Material von der negativen Elektrode angezogen, so dass eine Schicht positiver Ladung unterhalb des Gates entsteht. Auf dem Gate bildet sich eine entsprechende Gegenladung. Den sich einstellenden Zustand nennt man Akkumulation.","Bei einer positiven Spannung am Gate (UGB>0V) wandern die freien L\xf6cher von der positiven Elektrode weg. In dem ausger\xe4umten Gebiet verbleiben nur die (nicht gezeichneten) negativ ionisierten Dotierungsatome und es entsteht eine Raumladungszone. Diesen Zustand bezeichnet man als Verarmung.","Wird die Spannung am Gate weiter erh\xf6ht, so dass schlie\xdflich die Einsatzspannung \xfcberschritten wird (UGB>Uth,n), werden Elektronen-Loch Paare generiert, wobei die positiven L\xf6cher in das Substrat wandern, die negativen Elektronen jedoch von der positiven Elektrode angezogen werden, wo sie eine leitende Inversionsschicht bilden. Bei einem n-Kanal Feldeffekttransistor mit n-dotierten Source- und Drain-Anschl\xfcssen stellt dieser Elektronen-Kanal eine leitende Verbindung zwischen Source und Drain dar: Ein Feldeffekttransistor leitet also, wenn die Gate-Source Spannung die Einsatzspannung \xfcberschreitet."]),t.s)
B.A_=new A.c2("Das folgende Applet zeigt das Verhalten einer MOS-Struktur beim Anlegen unterschiedlicher Spannungen. Eine MOS-Struktur besteht aus einem Halbleiter (hier p-Typ) mit einer isolierenden Oxidschicht, auf der eine Metallelektrode aufgebracht ist. Zwischen der Metallelektrode (G) und dem Halbleiter (B) kann eine Spannung angelegt werden. Nach Vorgabe der Spannung werden die freien Ladungstr\xe4ger innerhalb der Struktur und die Ladungsdichten dargestellt.\n\nMan sieht:\n",B.Jp,"Englisch",B.V,null)
B.KM=A.a(s(["Ausgangspunkt der \xdcberlegungen ist das vereinfachte Ersatzschaltbild des zu kompensierenden Verst\xe4rkers mit den parasit\xe4ren Kapazit\xe4ten, welche die Polstellen der \xdcbertragungsfunktion a(jw) und damit den Frequenz- und Phasengang bestimmen. F\xfcr den zu untersuchenden kritischen Fall gr\xf6\xdftm\xf6glicher R\xfcckkopplung, d.h. k=1 bzw. 1/k=0dB, entspricht die Kurve |a(jw)| gleichzeitig der f\xfcr die Stabilit\xe4t wichtigen Schleifenverst\xe4rkung |a*k|. Die Frequenz wd, bei der der Betrag der Schleifenverst\xe4rkung gleich 1 ist, ergibt sich demnach aus dem Schnittpunkt der Kurve |a(jw)| mit der Frequenzachse.","F\xfcr den nicht kompensierten Verst\xe4rker sieht man, dass bei dieser Frequenz die Phase 180 Grad erreicht, der r\xfcckgekoppelte Verst\xe4rker w\xfcrde also schwingen.","Eine M\xf6glichkeit, den Verst\xe4rker zu stabilisieren, ist nun, die Kapazit\xe4t C1 zu vergr\xf6\xdfern. Dadurch verschiebt sich der Pol w1 der \xdcbertragungsfunktion, womit eine \xc4nderung des Frequenz- und des Phasengangs einhergeht. Insbesondere erreicht man jedoch, dass durch den jetzt fr\xfcher einsetzenden Verst\xe4rkungsabfall die Frequenz wd zu niedrigeren Werten hin verschoben wird, bei denen die Phasendrehung noch keine 180 Grad betr\xe4gt. Der Verst\xe4rker bleibt somit stabil.","Nachteilig ist jedoch, dass zur Kompensation sehr gro\xdfe Kapazit\xe4tswerte im nF-Bereich n\xf6tig sind, was f\xfcr integrierte Operationsverst\xe4rker nicht akzeptabel ist. Eine bessere Methode zur Kompensation ist daher die so genannte Miller-Kompensation."]),t.s)
B.A0=new A.Gm(null)
B.KK=A.a(s(["Bei dieser Art der Kompensation wird die Kompensationskapazit\xe4t Ck nicht parallel zu C1, sondern zwischen die beiden Verst\xe4rkerstufen eingef\xfcgt.","F\xfcr den nicht kompensierten Verst\xe4rker, d.h. Ck=0, sieht man, dass f\xfcr sehr hohe Frequenzen die Phasenverschiebung 180 Grad erreicht, der r\xfcckgekoppelte Verst\xe4rker w\xfcrde also schwingen.",'Durch Vergr\xf6\xdferung von Ck werden nun, da die beiden Verst\xe4rkerstufen nicht mehr unabh\xe4ngig voneinander sind, beide Pole beeinflusst. Insbesondere wandert der Pol p1 zu niedrigeren Frequenzen, wie es auch bereits bei der Kompensation durch Polverschiebung der Fall war. Zus\xe4tzlich verschiebt sich aber auch der Pol p2 zu h\xf6heren Frequenzen, so dass beide Pole weiter auseinanderstreben ("pole splitting") und damit der kritische Wert der Phasendrehung von 180 Grad erst bei h\xf6heren Frequenzen erreicht wird.',"Wichtigster Vorteil ist jedoch, dass bereits sehr kleine Werte von Ck ausreichen, um den Pol p1 zu verschieben. Der Grund daf\xfcr liegt darin, dass Ck zwischen beiden Verst\xe4rkerstufen liegt, und damit bereits kleine Spannungs\xe4nderungen an der Eingangsstufe gro\xdfe Spannungs\xe4nderungen \xfcber der Kapazit\xe4t bewirken. Diese wirkt dadurch wie eine um den Faktor der Spannungsverst\xe4rkung vergr\xf6\xdferte Kapazit\xe4t, die parallel zu C1 liegt (Miller-Effekt)."]),t.s)
B.A1=new A.Gn(null)
B.KJ=A.a(s(["Ersetzt man die imagin\xe4re Variable jw der \xdcbertragungsfunktion A(jw) formal durch die komplexe Gr\xf6\xdfe s=r+jw, so erh\xe4lt man eine Funktion A(s), die nun z.B. dem Betrag nach in der komplexen r-w Ebene dargestellt werden kann (unteres Bild). Man spricht in diesem Fall von analytischer Fortsetzbarkeit, da die urspr\xfcngliche Funktion mit imagin\xe4rem Argument ins Komplexe fortgesetzt wird. Dies ist auf Grund der Holomorphie rationaler Funktionen m\xf6glich.","Der Verlauf der Funktion |A(s)| in der komplexen Ebene ist durch die Lage der Null- und Polstellen eindeutig definiert. Insbesondere ist durch die Lage der Null- und Polstellen auch der Verlauf von |A(s)| f\xfcr r=0, d.h. entlang der Frequenzachse, festgelegt. Dies entspricht aber gerade dem Frequenzgang |A(jw)|, der f\xfcr positive Frequenzen, d.h. jw>0, im oberen Bild zur Verdeutlichung nochmals im logarithmischen Ma\xdfstab dargestellt ist.","Der Einfluss der Lage der Pole auf den Frequenzgang |A(jw)| wird deutlich, wenn in dem Beispiel der Parameter a und damit die Lage der Pole ge\xe4ndert wird. Verschieben sich diese z.B. f\xfcr kleiner werdendes a in Richtung der Frequenzachse (jw), so tritt im Frequenzgang eine deutliche \xdcberh\xf6hung auf. F\xfcr den Schaltungsentwickler interessant ist nun die Frage, welchen Einfluss Schaltungsparameter auf die Lage der Pole und damit auf den Frequenzgang der Schaltung haben."]),t.s)
B.A2=new A.Go(null)
B.KN=A.a(s(["F\xfcr eine gegebene Spannung UBE liefert der Schnittpunkt der jeweiligen Transistorausgangskennlinie mit der Lastgeraden den Wert des Stromes IC sowie der Ausgangsspannung UCE.","Soll eine sinusf\xf6rmige Basis-Emitter-Spannung (AC on) verst\xe4rkt werden, so ergibt sich die beste Verst\xe4rkerwirkung, wenn das Signal um eine Spannung UBE0 herum ge\xe4ndert wird, die in etwa in der Mitte des aussteuerbaren Bereiches, d.h. UBE0=0.72V, liegt.","Bei gr\xf6\xdferen oder kleineren Werten von UBE0 arbeitet der Transistor entweder im S\xe4ttigungs- oder im Sperrbetrieb, so dass die Verst\xe4rkung deutlich abnimmt."]),t.s)
B.A3=new A.c2(u.f,B.KN,"Englisch",B.V,null)
B.In=A.a(s(["Wie bei der einfachen Bipolar-Verst\xe4rkerschaltung mit ohmscher Last kann die \xdcbertragungskennlinie auch f\xfcr aktive Lastelemente grafisch konstruiert werden, indem das Ausgangskennlinienfeld IDS=IDS(UDS,UGS) des Transistors und die entsprechende Kennlinie IDS(UDS) des Lastelementes in ein Diagramm eingetragen werden. Die Schnittpunkte der Kurven ergeben dann f\xfcr gegebene Werte der Eingangsspannung UGS die dazugeh\xf6rigen Werte der Ausgangsspannung UDS.","Abh\xe4ngig von dem Lastelement (Widerstand, Anreicherungs-, oder Verarmungstransistor) ergeben sich unterschiedliche \xdcbertragungskennlinien des Inverters. Die Kleinsignalspannungsverst\xe4rkung, die der Steigung dUDS/dUGS der \xdcbertragungskennlinie entspricht, h\xe4ngt stark von der Form der Lastkennlinie ab. Sie wird um so gr\xf6\xdfer, je flacher die Lastkennlinie verl\xe4uft, d.h. je gr\xf6\xdfer der differentielle Widerstand r=dUDS/dIDS des Lastelementes ist. In analogen Verst\xe4rkerschaltungen werden daher statt Widerst\xe4nden als Lastelement oft aktive Lasten eingesetzt."]),t.s)
B.A4=new A.Gp(null)
B.Ii=A.a(s(["F\xfcr sehr gro\xdfe Basisweiten XB entspricht die Ladungstr\xe4gerverteilung der Basis-Emitter-Diode einem in Durchlassrichtung gepolten pn-\xdcbergang. Der Wert von n' an der Stelle x=0 wird dabei von der Spannung UBE \xfcber der Basis-Emitter-Diode bestimmt. Mit zunehmendem Abstand von der Raumladungszone nehmen die Minorit\xe4tstr\xe4gerdichten f\xfcr gro\xdfe Basisweiten dann exponentiell ab.","Der Basis-Kollektor-\xdcbergang des Transistors ist im Normalbetrieb in Sperrrichtung gepolt, so dass die \xdcberschussladungstr\xe4gerdichten n' und p' an den R\xe4ndern der Basis-Kollektor-Raumladungszone praktisch null sind.","Bringt man die beiden pn-\xdcberg\xe4nge sehr dicht zusammen, d.h. ist die Basisweite XB sehr klein, wird aus dem exponentiellen Verlauf der Ladungstr\xe4ger n' in der Basis (blaue Kurve) n\xe4herungsweise eine Gerade. Diese hat eine um so gr\xf6\xdfere Steigung, je kleiner die Basisweite XB ist."]),t.s)
B.A5=new A.c2("Dieses Applet veranschaulicht die Ladungstr\xe4gerverteilung eines Bipolartransistors im Normalbetrieb f\xfcr unterschiedliche Basisweiten.\n\nMan sieht:\n",B.Ii,"Englisch",B.V,null)
B.J3=A.a(s(["Fall 1: Schottky-Kontakt mit n-typ Halbleiter\nIst die angelegte Spannung U positiv, verschiebt sich das Ferminiveau Wfm im Metall gem\xe4\xdf W = -q\xb7U nach unten, was zu einer entsprechenden Verbiegung der B\xe4nder f\xfchrt. Dadurch wird die Potentialbarriere kleiner, so dass Elektronen (blau dargestellt) vom Halbleiter in das Metall gelangen k\xf6nnen. Wird die Spannung weiter erh\xf6ht, sinkt die Barriere immer mehr ab und der Elektronenstrom kann entsprechend zunehmen.\nIst die Spannung U hingegen negativ, so verschiebt sich das Ferminiveau Wfm im Metall nach oben und die Potentialbarriere f\xfcr Elektronen erh\xf6ht sich, so dass praktisch keine Elektronen vom Halbleiter in das Metall gelangen k\xf6nnen, d.h. es kann kein Strom flie\xdfen. Tr\xe4gt man das beschriebene Strom-Spannungsverhalten auf, zeigt der untersuchte \xdcbergang im Wesentlichen ein dioden\xe4hnliches Verhalten.","Fall 2: Ohmscher Kontakt mit n-typ Halbleiter\nEs ist keine Potentialbarriere vorhanden, die einen Elektronenstrom verhindern k\xf6nnte. Somit k\xf6nnen bei positiver Spannung U Elektronen praktisch ungehindert vom Halbleiter ins Metall und bei negativer Spannung vom Metall in den Halbleiter gelangen. Der Strom wird dabei nur vom ohmschen Widerstand der neutralen Bahngebiete begrenzt."]),t.s)
B.A6=new A.Gq(null)
B.Jj=A.a(s(["Eine Polstelle bewirkt einen Abfall des Betrages der \xdcbertragungsfunktion ab einer Grenzfrequenz, die von der Lage des Pols abh\xe4ngt. Je n\xe4her der Pol an der komplexen Achse liegt, um sehr niedriger ist die entsprechende Grenzfrequenz. Ebenfalls erfolgt eine Phasendrehung bei der Grenzfrequenz um -90 Grad.","Eine Nullstelle bewirkt einen Anstieg des Betrages der \xdcbertragungsfunktion sowie eine Phasendrehung um +90 Grad bei der zu der Nullstelle geh\xf6renden Grenzfrequenz.","Existieren mehrere Pol- oder Nullstellen, so \xfcberlagern sich deren Wirkungen. Insbesondere kompensieren sich Null- und Polstellen gegenseitig, wenn sie an der gleichen Stelle in der komplexen Ebene liegen.","Konjugiert komplexe Pole f\xfchren wegen des imagin\xe4ren Anteils zu Sinus- und Cosinus-Anteilen in der Sprungantwort. Der Realteil f\xfchrt zu einer exponentiellen D\xe4mpfung, wenn die Polstelle in der linken Halbebene liegt und zu einer ansteigenden Schwingung, wenn der Realteil des Poles positiv ist."]),t.s)
B.A7=new A.c2("Dieses Applet zeigt den Einfluss der Lage von Pol- (x) und Nullstellen (o) einer komplexen \xdcbertragungsfunktion auf den Amplituden- und Phasengang sowie die Sprungantwort. Im unteren, linken Fenster des Applets lassen sich Pol- und Nullstellen hinzuf\xfcgen, verschieben und l\xf6schen.\n        \nMan sieht: \n        ",B.Jj,"Englisch",B.V,null)
B.IC=A.a(s(["Bei USB=0 flie\xdft ein Strom zwischen Source (S) und Drain (D), da durch die angelegte Gate-Spannung die Potenzialbarriere zwischen Source und Bulk \xfcberwunden werden kann und somit Elektronen zur Drain-Elektrode gelangen k\xf6nnen.","Legt man eine gegen\xfcber der Source-Elektrode negative Spannung an das Bulk, d.h. USB>0, so verschieben sich die Bandkanten Wc und Wv im Bereich des Bulks nach oben. Damit erh\xf6ht sich die von den Elektronen zu \xfcberwindende Barriere, was sich in einer h\xf6heren Einsatzspannung Uth ausdr\xfcckt. F\xfcr USB=3V ist diese Barriere so gro\xdf, dass sie nicht mehr von den Elektronen \xfcberwunden werden kann. Die Einsatzspannung ist in diesem Fall gr\xf6\xdfer als die Spannung UGS und der Transistor sperrt."]),t.s)
B.A8=new A.c2("Das folgende Applet veranschaulicht den Substratsteuereffekt mit Hilfe des B\xe4nderdiagramms.\n\nMan sieht:\n",B.IC,"Englisch",B.V,null)
B.Kn=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Stromspiegels T1 und T2 und stellt damit die Lastkurve dar. Die rote Kurve entspricht der Ausgangskennlinie des Verst\xe4rkertransistors T3.","Der Schnittpunkt der beiden Kennlinien liefert den Wert des Stromes IC,A durch T2 und T3 sowie der Ausgangsspannung UCE,A im Arbeitspunkt.","Der Arbeitspunkt, d.h. der Strom IC,A durch die Transistoren T2 und T3 sowie die Spannung UCE,A am Ausgang der Schaltung l\xe4sst sich bei einer vorgegebenen Spannung UBE,A durch den Transistorparameter IS3 beeinflussen. IS3 kann dabei z.B. \xfcber die Gr\xf6\xdfe des Transistors T3 eingestellt werden.","Der Strom IC,A ist dabei im Wesentlichen durch den Stromspiegel T1 und T2 eingepr\xe4gt und \xe4ndert sich daher auch bei \xc4nderungen des Transistorparameters IS3 nur sehr wenig.","Die Spannung UCE,A im Arbeitspunkt reagiert jedoch sehr empfindlich auf \xc4nderungen des Parameters IS3. Diese Empfindlichkeit wird um so gr\xf6\xdfer, je geringer der Early-Effekt ist, d.h. je gr\xf6\xdfer die Early-Spannung Uan ist."]),t.s)
B.Aa=new A.c2("Dieses Applet veranschaulicht die Arbeitspunkteinstellung bei einem Verst\xe4rker mit Stromspiegel.\n\nMan sieht:\n",B.Kn,"Englisch",B.V,null)
B.Kz=A.a(s(["F\xfcr T=0 nehmen die Elektronen ihren jeweils niedrigstm\xf6glichen Energiezustand an. Da nach dem Pauli-Prinzip ein Zustand jedoch nur mit maximal zwei Elektronen besetzt werden kann, sind auch von Null verschiedene Zust\xe4nde mit Elektronen besetzt. Die Energie, bis zu der bei T=0 alle Zust\xe4nde besetzt sind, bezeichnet man als das Ferminiveau Wf.","Die Besetzungswahrscheinlichkeit F(W) ist bei T=0 daher F(W)=1 f\xfcr alle Energieniveaus unterhalb des Ferminiveaus und F(W)=0 f\xfcr alle Energieniveaus oberhalb des Ferminiveaus.","Eine Erh\xf6hung der Temperatur T f\xfchrt zu einer Zunahme der Gesamtenergie in dem System. Dies \xe4u\xdfert sich darin, dass einzelne Elektronen auch h\xf6here Energiezust\xe4nde annehmen k\xf6nnen. Die Besetzungswahrscheinlichkeit F(W) h\xf6herer Zust\xe4nde nimmt daher zu und die niedriger Zust\xe4nde entsprechend ab.","Je h\xf6her die Temperatur ist, um so h\xf6her ist die Gesamtenergie des Systems. Die Wahrscheinlichkeit, dass ein energetisch hochliegender Zustand besetzt ist, steigt demnach mit zunehmender Temperatur immer weiter an. Gleichzeitig nimmt die Wahrscheinlichkeit, dass energetisch tiefliegende Zust\xe4nde besetzt sind, ab."]),t.s)
B.Ab=new A.c2("Dieses Applet veranschaulicht die Bedeutung der Fermiverteilung F(W) und des Ferminiveaus anhand eines Systems mit diskreten Energiezust\xe4nden.\n\nMan sieht:\n",B.Kz,"Englisch",B.V,null)
B.K7=A.a(s(["Bei sehr niedrigen Temperaturen sind alle Bindungen im Halbleiterkristall intakt. Es sind keine freien Elektronen vorhanden, die zum Stromtransport beitragen k\xf6nnen. In der B\xe4nderdiagrammdarstellung bedeutet dies, dass sich alle Elektronen im so genannten Valenzband befinden; das obere Energieband (Leitungsband) ist unbesetzt.","Wird die zum L\xf6sen einer Bindung n\xf6tige Energie (z.B. durch Erh\xf6hung der Temperatur) \xfcberschritten, entstehen freie Elektronen. Diese freien Elektronen befinden sich in der B\xe4nderdiagrammdarstellung im so genannten Leitungsband. Der Abstand von Leitungsband zu Valenzband, der Bandabstand Wg, entspricht dabei der Energie, die zugef\xfchrt werden muss, um eine Bindung zu l\xf6sen.","An den Stellen, wo vorher die jetzt freien Elektronen sa\xdfen, bleibt jeweils eine L\xfccke (ein so genanntes Loch) zur\xfcck. Diesem Loch kann - wegen der fehlenden negativen Ladung des Elektrons - eine positive Ladung zugeordnet werden. Da in diese L\xfccke wiederum andere Elektronen springen k\xf6nnen, tragen auch L\xf6cher zum Ladungstransport bei.","Durch das L\xf6sen von Bindungen zwischen Si-Atomen werden L\xf6cher und Elektronen paarweise generiert, so dass ihre Anzahl stets gleich gro\xdf ist.","Die Zahl der freien Ladungstr\xe4ger (Elektronen und L\xf6cher) in einem undotierten Halbleiter ist bei moderaten Temperaturen \xe4u\xdferst gering. Erst bei sehr hohen Temperaturen steigt die Anzahl der freien Ladungstr\xe4ger deutlich an. Durch Dotieren, d.h. den Einbau von Fremdatomen in den Halbleiter, kann jedoch die Zahl der freien L\xf6cher oder Elektronen gezielt ver\xe4ndert und bereits bei Raumtemperatur deutlich erh\xf6ht werden."]),t.s)
B.Ac=new A.c2("Ein undotierter Silizium-Halbleiter besteht ausschlie\xdflich aus vierwertigen Siliziumatomen (Si), die in einer regelm\xe4\xdfigen Kristallstruktur angeordnet sind. Dabei gehen die vier Valenzelektronen eines jeden Siliziumatoms so genannte kovalente Bindungen mit den Elektronen der benachbarten Si-Atome ein. Das Applet zeigt das Verhalten eines undotierten Halbleiters bei \xc4nderung der Temperatur. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im so genannten B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.K7,"Englisch",B.V,null)
B.J1=A.a(s(["Durch Bestrahlung werden Ladungstr\xe4gerpaare im Innern der Fotodiode generiert. Eine Erh\xf6hung der Bestrahlungsst\xe4rke Ee f\xfchrt zu einem Anstieg der Generationsrate und somit zu einer h\xf6heren Anzahl freier Ladungstr\xe4ger. Umgekehrt f\xfchrt eine Verringerung der Bestrahlungsst\xe4rke zu einer Verringerung der Generationsrate.","Die durch die Bestrahlung generierten Ladungstr\xe4ger werden durch das eingebaute elektrische Feld E der Raumladungszone sofort getrennt und zu den neutralen Bahngebieten hin abtransportiert, ohne dass dazu eine externe Spannung notwendig ist. Der Fotostrom steht daher direkt an den Elektroden der Fotodiode zur Verf\xfcgung. Der Fotostrom ist proportional zu der Bestrahlungsst\xe4rke Ee und in erster N\xe4herung unabh\xe4ngig von der angelegten Spannung U (der Grund hierf\xfcr ist, dass das eingebaute elektrische Feld E der Raumladungszone bereits gro\xdf genug ist, um die Ladungstr\xe4ger auf ihre S\xe4ttigungsgeschwindigkeit zu beschleunigen. Eine weitere Erh\xf6hung des elektrischen Feldes durch \xc4nderung der Spannung U f\xfchrt dann zu keiner weiteren Erh\xf6hung der Geschwindigkeit der Ladungstr\xe4ger - und damit zu keinem Anstieg des Stromes)."]),t.s)
B.Ad=new A.c2("Dieses Applet veranschaulicht die Funktion einer Fotodiode. Die in der linken Bildh\xe4lfte des Applets schematisch dargestellte Fotodiode besitzt eine pin-Struktur, d.h. zwischen dem p- und dem n-Gebiet liegt ein undotiertes (intrinsisches) i-Gebiet (grau dargestellt). Das p- und das n-Gebiet bewirken eine \xfcber das gesamte i-Gebiet ausgedehnte Raumladungszone mit einer hohen elektrischen Feldst\xe4rke E. Aus Gr\xfcnden der \xdcbersichtlichkeit werden nur die durch Bestrahlung generierten freien Ladungstr\xe4ger animiert. Die rechte Bildh\xe4lfte des Applets zeigt die Strom-Spannungs Kennlinie des Bauelementes, wobei der aktuelle Arbeitspunkt durch einen roten Punkt gekennzeichnet ist. Hellgrau schattiert ist der dritte Quadrant der Kennlinie (U<0 und I<0); in diesem Quadranten arbeitet die Fotodiode im Diodenbetrieb. Mit Hilfe der vier Schaltfl\xe4chen im unteren Bereich des Applets k\xf6nnen die Bestrahlungsst\xe4rke Ee sowie die angelegte Spannung U variiert werden.\n\nMan sieht:\n",B.J1,"Englisch",B.V,null)
B.J4=A.a(s(["Liegt keine \xe4u\xdfere Spannung \xfcber der Struktur (U=0V), ist der pn-\xdcbergang im thermodynamischen Gleichgewicht (TGG). In der gezeigten B\xe4nderdiagrammdarstellung liegt das Ferminiveau Wf im TGG \xfcberall auf gleicher H\xf6he. In diesem Fall liegen auch die Pegel der Elektronen im p- und im n-Gebiet auf gleicher H\xf6he, so dass keine Netto-Ausgleichsbewegung, d.h. Bewegung von Elektronen von einem Gebiet in das andere, erfolgt. Entsprechendes gilt f\xfcr die L\xf6cher, deren Pegel ebenfalls auf gleichem Niveau liegen.","Durch das Anlegen einer \xe4u\xdferen elektrischen Spannung U>0V an die Struktur verschieben sich die Bandkanten gem\xe4\xdf U=-W/q, wobei in der Darstellung der Anschaulichkeit halber der ohmsche Spannungsabfall im Halbleitermaterial (vgl. Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm) vernachl\xe4ssigt ist. Der Pegel der Elektronen im n-Gebiet liegt in diesem Fall \xfcber dem der Elektronen in p-Gebiet, so dass Elektronen durch die Raumladungszone in das p-Gebiet wandern. Diese \xfcbersch\xfcssigen Elektronen f\xfchren zu einer lokalen St\xf6rung des TGG, und damit einer Zunahme der Rekombination (G<R) der \xfcbersch\xfcssigen Elektronen mit L\xf6chern, die st\xe4ndig aus dem p-Gebiet nachgeliefert werden, was einem Stromfluss entspricht. Entsprechende \xdcberlegungen gelten f\xfcr die L\xf6cher, deren Pegel im p-Gebiet unter dem im n-Gebiet liegt.","Bei einer Spannung U<0V verschieben sich die B\xe4nder in umgekehrte Richtung, so dass nun Minorit\xe4tstr\xe4ger \xfcber die Raumladungszone in das benachbarte Gebiet gelangen k\xf6nnen. Wegen der sehr geringen Tr\xe4gerdichte der Minorit\xe4tstr\xe4ger wandern jedoch nur sehr wenige Ladungstr\xe4ger durch die Raumladungszone, was einem sehr kleinen Strom entspricht, der auch mit zunehmender Sperrspannung nicht wesentlich ansteigt."]),t.s)
B.Ae=new A.c2("Dieses Applet zeigt f\xfcr einen pn-\xdcbergang die Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm abh\xe4ngig von der angelegten Spannung.\n\nMan sieht:\n",B.J4,"Englisch",B.V,null)
B.cw=A.a(s([]),t.s)
B.Af=new A.c2("Dieses Applet zeigt den prinzipiellen Ablauf eines NMOS-Prozesses am Beispiel der Herstellung eines n-Kanal Feldeffekttransistors. Der Anschaulichkeit halber sind nicht alle Prozessschritte im Einzelnen gezeigt und die Darstellungen sind zum Teil grob vereinfacht.\n",B.cw,"Englisch",B.cw,null)
B.Ah=new A.c2("Dieses Applet zeigt den stark vereinfachten Ablauf eines CMOS-Prozesses zur Herstellung integrierter Schaltungen. Im Gegensatz zum NMOS Prozess erlaubt der CMOS-Prozess die gleichzeitige Herstellung von n- und p-Kanal Feldeffekttransistoren auf einem Chip.\n",B.cw,"Englisch",B.V,null)
B.Kr=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Bor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (dreiwertige) B-Atome, so gehen jeweils die drei Elektronen des Bor-Atoms (B) eine Bindung mit den benachbarten Si-Atomen ein.","Da bei dem Boratom ein Elektron zur Bindung fehlt, existiert an dieser Stelle eine L\xfccke, die zun\xe4chst noch an das Boratom gebunden ist. Es gen\xfcgt jedoch bereits eine sehr geringe Energiezufuhr (z.B. geringe Temperaturerh\xf6hung), damit sich ein vorher im Kristallgitter gebundenes Valenzelektron in diese L\xfccke setzt, d.h. an das Boratom (den so genannten Akzeptor) bindet. Dadurch entsteht an der Stelle, an der vorher das Valenzelektron sa\xdf, ein freies Loch, in das wiederum ein anderes Elektron springen kann. Die geringe Ionisierungsenergie des Boratoms entspricht im B\xe4nderdiagramm dem geringen Abstand des Energieniveaus des Akzeptors Wa zum Valenzband Wv.","Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (hier: 100K) alle Boratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien L\xf6cher po gleich der Dichte NA der Dotierungsatome ist.","Der negative Atomrumpf (B-) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Es erh\xf6ht sich demnach nur die Anzahl der freien L\xf6cher, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Bor dotierten Halbleiter die freien L\xf6cher ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem p-Typ Halbleiter."]),t.s)
B.Ai=new A.c2("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Bor) die Anzahl der freien L\xf6cher erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.Kr,"Englisch",B.V,null)
B.Kq=A.a(s(["Durch die Injektion zus\xe4tzlicher Ladungstr\xe4ger am linken Rand der Probe entsteht ein Konzentrationsgef\xe4lle, aufgrund dessen eine Diffusionsbewegung der Ladungstr\xe4ger von links nach rechts einsetzt.","Durch die Erh\xf6hung der Ladungstr\xe4gerdichten steigt die Rekombinationsrate R (R ~ n*p), so dass \xfcbersch\xfcssige Ladungstr\xe4ger paarweise rekombinieren. Die Tr\xe4gerdichten nehmen mit zunehmender Entfernung von der Injektionsstelle also wieder ab, bis sie schlie\xdflich sehr weit rechts von der Injektionsstelle wieder die Gleichgewichtswerte (n=n0 bzw. p=p0) erreicht haben.","Das gleiche Ergebnis h\xe4tte man erhalten, wenn man nur Minorit\xe4tstr\xe4ger (hier: L\xf6cher) injiziert h\xe4tte. Wegen des sich dann ergebenden Ladungsungleichgewichtes und dem dadurch hervorgerufenen elektrischen Feld h\xe4tte sich \"sofort\" (genauer: innerhalb der so genannten \"dielektrischen Relaxationszeit\") eine gleiche Anzahl zus\xe4tzlicher Elektronen aus dem n-Halbleiter angefunden, so dass gilt n'=p'. Die Minorit\xe4tstr\xe4ger bestimmen in diesem Experiment also im Wesentlichen das Verhalten des Halbleiters, insbesondere wird der abnehmende Verlauf der \xdcberschussladungstr\xe4gerdichten n' bzw p' allein durch die Minorit\xe4tstr\xe4gerlebensdauer bestimmt.","Tr\xe4gt man die Dichte der \xdcberschussladungstr\xe4ger p'=n' \xfcber dem Ort x auf, so ergibt sich eine abklingende Exponentialfunktion mit der Abklingkonstanten Lp, der so genannten Diffusionsl\xe4nge, welche proportional zu der Lebensdauer der Minorit\xe4tstr\xe4ger ist. Die Diffusionsl\xe4nge Lp kann demnach als die von den Ladungstr\xe4gern w\xe4hrend der Lebensdauer im Mittel zur\xfcckgelegten Strecke interpretiert werden.","Eine \xc4nderung der Minorit\xe4tstragerlebensdauer bzw. der Diffusionsl\xe4nge f\xfchrt zu einer \xc4nderung der Verteilung der Ladungstr\xe4ger und damit auch zu einer \xc4nderung der in dem Halbleiter gespeicherten Ladungsmenge."]),t.s)
B.Aj=new A.c2("Ebenso wie nach einer tempor\xe4ren St\xf6rung des thermodynamischen Gleichgewichtes (z.B. durch Lichteinstrahlung) strebt der Halbleiter auch bei einer lokalen St\xf6rung stets wieder den Gleichgewichtszustand an.\n\nDas folgende Applet zeigt das Verhalten einer n-Typ Halbleiterprobe bei einer lokalen St\xf6rung des TGGs durch st\xe4ndige Injektion von Elektronen und L\xf6chern am linken Rand (x=0) der Probe. Der Anschaulichkeit halber werden in dem Halbleiter nur die durch Injektion zus\xe4tzlich vorhandenen Ladungstr\xe4ger (n' bzw. p') dargestellt.\n\nMan sieht:\n",B.Kq,"Englisch",B.V,null)
B.Jq=A.a(s(["Aus der \xdcbertragungskennlinie des Verst\xe4rkers erkennt man, dass ein Eingangssignal UBE nur im mittleren Bereich der Kennlinie verst\xe4rkt wird, in dem die Steigung dUCE/dUBE gro\xdf ist.","Um ein sinusf\xf6rmiges Eingangssignal mit der Amplitude ube verzerrungsfrei zu verst\xe4rken, muss diesem demnach ein Gleichanteil UBE0 \xfcberlagert werden, so dass das Eingangssignal stets im mittleren Bereich der Kennlinie verl\xe4uft. Der Gleichanteil UBE0 legt dabei den so genannten Arbeitspunkt der Verst\xe4rkerschaltung fest.","Liegt der Arbeitspunkt in der Mitte der Kennlinie, kann die Amplitude ube des Eingangssignals sehr gro\xdf gew\xe4hlt werden, ohne dass Begrenzungseffekte und damit Verzerrungen auftreten. Diese Betriebsart nennt man A-Betrieb.","Liegt der Arbeitspunkt auf dem Wert UBE0=0V, so spricht man vom B-Betrieb. Bei dieser Betriebsart wird die untere Halbwelle des Eingangssignals vollst\xe4ndig und die obere zum Teil abgeschnitten, das Signal also stark verzerrt.","Beim so genannten AB-Betrieb liegt der Arbeitspunkt UBE0 etwa im Knickpunkt der Kennlinie bei relativ kleinen Spannungen UBE0. Die untere Halbwelle des Eingangssignals wird zwar abgeschnitten, die obere Halbwelle des Eingangssignals wird jedoch bis hin zu sehr gro\xdfen Amplituden verzerrungsfrei \xfcbertragen.","Der C-Betrieb ist durch eine negative Vorspannung UBE0<0 gekennzeichnet. Diese Betriebsart wird z.B. bei Sender\xf6hren angewandt."]),t.s)
B.Ak=new A.c2(u.f,B.Jq,"Englisch",B.V,null)
B.IR=A.a(s(["Bei undotierten Halbleitern liegt das Ferminiveau etwa in der Mitte des verbotenen Bandes.","Dotiert man den Halbleiter mit Donatoren (Erh\xf6hung von ND), so wandert der Schnittpunkt der beiden Kurven zur Leitungsbandkante Wc. Bei einer Dotierung mit Akzeptoren wandert das Ferminiveau entsprechend zur Valenzbandkante Wv.","Wird der Halbleiter sowohl mit Donatoren als auch mit Akzeptoren dotiert, so wird das Verhalten des Halbleiters (n- oder p-Typ) allein durch die Dotieratome mit der h\xf6heren Konzentration bestimmt.","Da f\xfcr einen undotierten Halbleiter die Tr\xe4gerdichten n0 und p0 gleich der Eigenleitungstr\xe4gerdichte ni sind und das Ferminiveau WF gleich dem Eigenleitungsniveau Wi ist, folgen unmittelbar die wichtigen Beziehungen:"]),t.s)
B.Al=new A.Gr(null)
B.Ko=A.a(s(["Liegt das Ferminiveau in der Mitte zwischen Valenz- und Leitungsbandkante (undotierter Halbleiter), so sind die Kurven nw und pw symmetrisch zu Wf. Insbesondere sind die Fl\xe4chen unter den beiden Kurven und damit die Anzahl der freien Ladungstr\xe4ger n0 und p0 gleich gro\xdf.","Eine Erh\xf6hung der Temperatur f\xfchrt wegen des sich \xe4ndernden Verlaufes der Fermiverteilung zu einer Erh\xf6hung beider Tr\xe4gerdichten.","Bei einem n-dotierten Halbleiter, bei dem das Ferminiveau Wf und damit die gesamte Kurve F(W) nach oben verschoben ist, ergibt die Multiplikation und anschlie\xdfende Integration der Kurven einen h\xf6heren Wert f\xfcr die Elektronendichte n0 und einen kleineren Wert f\xfcr die L\xf6cherdichte p0. Umgekehrtes gilt f\xfcr einem p-Typ Halbleiter. Die Lage des Ferminiveaus Wf bestimmt also unmittelbar die Tr\xe4gerdichten im thermodynamischen Gleichgewicht."]),t.s)
B.Am=new A.Gs(null)
B.HY=A.a(s(["Liegt ein Elektron energiem\xe4\xdfig oberhalb der Bandkante Wc, so besitzt es zus\xe4tzliche kinetische Energie und damit einen Impuls i. Die Impulsvektoren aller Teilchen mit einer Energie zwischen W und W+dW haben demnach einen Impuls zwischen i und i+di, so dass die Impulsvektoren auf einer Kugelschale mit dem Radius i und der Dicke di liegen.","Die Zahl der voneinander unterscheidbaren Impulsvektoren auf der Kugelschale ist jedoch begrenzt, da der Impuls nach der Heisenbergschen Unsch\xe4rferelation eine gewisse Unsch\xe4rfe hat, wenn der Ort des Teilchens genau bestimmt ist. Die Impulsvektoren m\xfcssen also einen bestimmten Mindestabstand voneinander haben.","Erh\xf6ht man nun die Energie W und damit den Impuls i, entspricht das einer Vergr\xf6\xdferung der Kugelschale, so dass nun mehr Impulsvektoren Platz finden; die Zustandsdichte nimmt zu."]),t.s)
B.An=new A.c2("Dieses Applet veranschaulicht den Begriff der Zustandsdichte.\n\nMan sieht:\n",B.HY,"Englisch",B.V,null)
B.J2=A.a(s(["W\xe4hlt man UBE=0V, so liegen die Ferminiveaus Wf in Emitter und Basis auf gleicher H\xf6he. Wegen UCE=+1V liegt das Ferminiveau im Kollektor gem\xe4\xdf W = -q\xb7U unterhalb der Ferminiveaus in Emitter und Basis. Aufgrund der unterschiedlichen Dotierungen von Emitter und Basis liegen die Bandkanten Wv und Wc in diesen Bereichen relativ zum Ferminiveau auf unterschiedlicher H\xf6he. Dadurch ergibt sich eine Potenzialbarriere, die die Elektronen \xfcberwinden m\xfcssen, wenn sie sich von dem n-dotierten Emitter in den n-dotierten Kollektor bewegen.","Erh\xf6ht man nun die Basis-Emitter-Spannung UBE, so verringert sich die Potenzialbarriere zwischen Emitter und Basis. Elektronen, die im Emitter als Majorit\xe4tstr\xe4ger zahlreich zur Verf\xfcgung stehen, k\xf6nnen jetzt ungehindert vom Emitter \xfcber die Basis in den Kollektor gelangen. Es flie\xdft ein Strom."]),t.s)
B.Ao=new A.c2("Das folgende Applet zeigt die Funktionsweise des Bipolartransistors schematisch anhand des B\xe4nderdiagramms.\n\nMan sieht:\n",B.J2,"Englisch",B.V,null)
B.HW=A.a(s(["Der Wert der Raumladungsdichte wird durch die Dotierung in dem entsprechenden Gebiet bestimmt, also durch ND im n-Gebiet und durch NA im p-Gebiet.","Aus Neutralit\xe4tsgr\xfcnden m\xfcssen sich die Ladungen im p- und n-Gebiet gegenseitig kompensieren, d.h. die Fl\xe4chen unter den Rechtecken m\xfcssen gleich gro\xdf sein.","Daraus folgt, dass sich die Raumladungszone um so weiter in den Halbleiter erstreckt, je geringer die Dotierung ist. Gleichzeitig wird die Raumladung und damit das elektrische Feld kleiner."]),t.s)
B.Ap=new A.c2("Dieses Applet zeigt, wie sich die Raumladungszone eines pn-\xdcberganges mit den Dotierungsdichten NA und ND des p- und des n-Gebietes \xe4ndert.\n\nMan sieht:\n",B.HW,"Englisch",B.V,null)
B.IJ=A.a(s(["Eine Erh\xf6hung des Stromes IB0 am Eingang f\xfchrt zun\xe4chst zu einem Anstieg des Stromes IC im Ausgangskreis. Gleichzeitig verringert sich die Spannung UCE am Ausgang, da der Spannungsabfall \xfcber Rc gr\xf6\xdfer wird.","Erh\xf6ht man das Eingangssignal immer weiter, wird die Spannung UCE am Ausgang sehr klein, so dass die Basis-Kollektor Diode schlie\xdflich in Durchlassrichtung geschaltet wird und der Transistor in S\xe4ttigung geht. Dadurch verringert sich die Stromverst\xe4rkung B. Der Strom IC steigt dann trotz weiterer Zunahme von IB0 nicht mehr weiter an.","Wird der Eingang des Verst\xe4rkers mit einem Sinussignal angesteuert (AC on), so muss ein geeigneter Eingangsruhestrom IB0 eingestellt werden, damit das Sinussignal vollst\xe4ndig \xfcbertragen wird."]),t.s)
B.Ar=new A.c2("Dieses Applet veranschaulicht die Funktion eines Verst\xe4rkers mit Bipolartransistor.\n\nMan sieht:\n",B.IJ,"Englisch",B.V,null)
B.II=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Stromspiegels T3 und T4 und stellt damit die Lastkurve dar. Die rote Kurve entspricht der Ausgangskennlinie des Verst\xe4rkertransistors T2.","Der Schnittpunkt der beiden Kennlinien liefert den Wert des Stromes durch die beiden Transistoren T2 und T4 sowie den Wert der Ausgangsspannung Ua. Die Ausgangsspannung im Arbeitspunkt kann bei der Schaltung z.B. auf den Wert Ua,A = 0V eingestellt werden.","Wegen des flachen Verlaufs der Kennlinien haben bereits kleine \xc4nderungen der Eingangsspannung Ue gro\xdfe Auswirkungen auf die Lage des Schnittpunktes der beiden Kurven und damit auf die Spannung Ua am Ausgang der Schaltung. Die Verst\xe4rkung dieser Schaltung f\xfcr Differenzeingangssignale ist daher sehr gro\xdf.","Da die Verst\xe4rkung um so gr\xf6\xdfer ist, je flacher die Steigung der Kennlinien ist, steigt die Verst\xe4rkung mit zunehmendem Ausgangswiderstand r0, d.h. mit abnehmendem Kanall\xe4ngenmodulationsfaktor Lambda der Transistoren."]),t.s)
B.As=new A.c2("Dieses Applet veranschaulicht die Funktion des Differenzverst\xe4rkers mit Stromspiegel bei Ansteuerung mit Differenzsignalen.\n\nMan sieht:\n",B.II,"Englisch",B.V,null)
B.KI=A.a(s(["Bei Upn=0 flie\xdft kein Strom durch die Diode, da sich die durch den Konzentrationsgradienten hervorgerufene Diffusionsbewegung und die durch das elektrische Feld in der Raumladungszone verursachte Driftbewegung der Ladungstr\xe4ger gerade aufheben.","Bei einer Spannung Upn>0 verringert sich das elektrische Feld in der Raumladungszone, so dass die Diffusion \xfcberwiegt. Dadurch diffundieren die Majorit\xe4tstr\xe4ger durch die Raumladungszone hindurch in das jeweils andere Gebiet wo sie schlie\xdflich mit den dortigen Majorit\xe4tstr\xe4gern rekombinieren. Letztere m\xfcssen daher st\xe4ndig aus den neutralen Gebieten nachgeliefert werden, so dass ein Strom I durch die Diode flie\xdft.","Mit zunehmender Spannung Upn dominiert die Diffusion immer mehr, so dass auch der Strom I immer gr\xf6\xdfer wird.","Wird die Diode in Sperrrichtung gepolt, dominiert wegen des gr\xf6\xdfer werdenden elektrischen Feldes der Driftstrom. Dieser f\xfchrt dazu, dass sich Minorit\xe4tstr\xe4ger durch die Raumladungszone bewegen. Wegen der sehr geringen Dichte der Minorit\xe4tstr\xe4ger ist der Strom jedoch sehr klein."]),t.s)
B.At=new A.c2("Dieses Applet veranschaulicht die Funktion einer pn-Diode.\n\nMan sieht:\n",B.KI,"Englisch",B.V,null)
B.JG=A.a(s(["Liegt das Ferminiveau WF in der Mitte zwischen den beiden Bandkanten auf dem Intrinsicniveau Wi, so sind die Elektronendichte und die L\xf6cherdichte gleich der Intrinsicdichte ni.","Eine Verschiebung des Ferminiveaus zur Leitungsbandkante (was einem n-Typ Halbleiter entspricht) f\xfchrt zu einem Anstieg der Elektronendichte n0 und einer Abnahme der L\xf6cherdichte p0.","Bei einem p-Typ Halbleiter, bei dem das Ferminiveau zur Valenzbandkante verschoben ist, ist dagegen die L\xf6cherdichte erh\xf6ht und die Elektronendichte vermindert.","In allen F\xe4llen gilt, dass (im thermodynamischen Gleichgewicht) das Produkt aus Elektronendichte und L\xf6cherdichte gleich ni^2 ist (Massenwirkungsgesetz), was sich in der logarithmischen Darstellung deutlich zeigt."]),t.s)
B.Au=new A.Gt(null)
B.KS=A.a(s(["Im Bode-Diagramm ist der typische Frequenzgang |a(jw)| und der Phasengang Phase[a(jw)] eines nicht r\xfcckgekoppelten Verst\xe4rkers a mit abnehmender Verst\xe4rkung f\xfcr hohe Frequenzen dargestellt, wie er sich z.B. f\xfcr einen Operationsverst\xe4rker ergibt.","Zus\xe4tzlich ist in das Diagramm der Kehrwert 1/k des - hier frequenzunabh\xe4ngigen - R\xfcckkopplungsfaktors eingetragen, was einem R\xfcckkopplungsnetzwerk mit ohmschen Widerst\xe4nden entspricht.","F\xfcr die Gesamtverst\xe4rkung des r\xfcckgekoppelten Systems gilt A = a/(1+ak). Da f\xfcr gro\xdfe Werte von a n\xe4herungsweise A=1/k gilt, kann man A direkt aus dem Diagramm ablesen. F\xfcr gr\xf6\xdfer werdendes k, d.h. st\xe4rkere R\xfcckkopplung, sieht man deutlich die Abnahme der Gesamtverst\xe4rkung.","Die f\xfcr die Stabilit\xe4t wichtige Schleifenverst\xe4rkung a*k ergibt sich in der logarithmischen Darstellung wegen a*k=a/(1/k) aus dem Abstand der Kurve a zur Kurve 1/k und kann ebenfalls direkt abgelesen werden.","Insbesondere ist am Schnittpunkt der Kurven a und 1/k der Betrag |a*k| der Schleifenverst\xe4rkung gleich 1 (=0dB). Ist nun bei dieser Frequenz wd die Phase gleichzeitig 180 Grad, so ist a*k = -1, d.h. der Verst\xe4rker ist instabil und schwingt.","F\xfcr kleine R\xfcckkopplungsfaktoren k ist bei der Frequenz wd die Phase sehr weit von dem kritischen Wert 180 Grad entfernt, der Verst\xe4rker ist stabil.","F\xfcr zunehmendes k, d.h. st\xe4rkere R\xfcckkopplung, r\xfcckt die Phase bei der Frequenz wd, wo der Betrag der Schleifenverst\xe4rkung gleich 1 ist, immer n\xe4her an 180 Grad, der Verst\xe4rker wird instabil und schwingt.","Um Stabilit\xe4t des r\xfcckgekoppelten Verst\xe4rkers f\xfcr beliebiges k zu gew\xe4hrleisten, greift man zur so genannten Kompensation. Dabei wird der Frequenz- und Phasengang des nicht r\xfcckgekoppelten Verst\xe4rkers durch schaltungstechnische Ma\xdfnahmen so ge\xe4ndert, dass die Phase an der Stelle wd f\xfcr beliebige k 180 Grad nicht erreicht."]),t.s)
B.Av=new A.c2("Dieses Applet zeigt den Zusammenhang zwischen der Schleifenverst\xe4rkung eines gegengekoppelten Verst\xe4rkers und dessen Stabilit\xe4t.\n\nMan sieht:\n",B.KS,"Englisch",B.V,null)
B.Jy=A.a(s(["F\xfcr die gezeigte Schaltung kann die \xdcbertragungskennlinie grafisch konstruiert werden, indem das Ausgangskennlinienfeld IC=IC(UCE,UBE) des Transistors und die Kennlinie IC(UCE) des Widerstandes in ein Diagramm eingetragen werden. F\xfcr einen gegebenen Wert von UBE ergibt dann der Schnittpunkt der entsprechenden Transistorkennlinie mit der Widerstandsgeraden den dazugeh\xf6rigen Wert f\xfcr UCE.","Die Steigung dUCE/dUBE der \xdcbertragungskennline entspricht der Kleinsignalspannungsverst\xe4rkung Au. F\xfcr Werte UBE unter etwa 0,6V ist die Steigung und damit die Verst\xe4rkung etwa Null, da der Transistor sperrt. F\xfcr gro\xdfe Werte von UBE geht die Verst\xe4rkung ebenfalls gegen Null, da der Transistor in S\xe4ttigung geht."]),t.s)
B.Aw=new A.c2("Dieses Applet zeigt die Konstruktion der \xdcbertragungskennlinie UCE=UCE(UBE) eines einfachen Verst\xe4rkers sowie den Einfluss wichtiger Schaltungsparameter (UB, R) auf die Verst\xe4rkung.\n\nMan sieht:\n",B.Jy,"Englisch",B.V,null)
B.IF=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Transistors T2 des Stromspiegels.","Im aktiven Vorw\xe4rtsbetrieb, d.h. f\xfcr UBC > 0V, verl\xe4uft die Kennlinie sehr flach, so dass der Strom Io n\xe4herungsweise konstant ist.","Nimmt die Spannung Uo am Ausgang des Stromspiegels zu, vermindert sich die Spannung UBC, bis der Basis-Kollektor-\xdcbergang des Transistors T2 schlie\xdflich f\xfcr UBC < 0V in Durchlassrichtung gepolt wird. Der Transistor T2 geht dann in S\xe4ttigung und der Strom Io nimmt ab.","Sind beide Transistoren gleich gro\xdf, d.h., ist IS1 = IS2, so entspricht der Strom Io im aktiven Vorw\xe4rtsbetrieb etwa dem Strom Iref durch den Referenztransistor T1.","Das Stromverh\xe4ltnis Io zu Iref kann \xfcber das Verh\xe4ltnis IS1 zu IS2 eingestellt werden, so dass sich mit dem Stromspiegel beliebige Str\xf6me generieren lassen.","Die Steigung der Kennlinie des Transistors T2 h\xe4ngt von dem Ausgangswiderstand r0 des Transistors und damit von der Early-Spannung Uan ab. Je gr\xf6\xdfer die Early-Spannung Uan ist, um so flacher verl\xe4uft die Kennlinie, d.h. um so weniger h\xe4ngt der eingestellte Strom Io von der Spannung Uo ab."]),t.s)
B.Ax=new A.c2("Dieses Applet veranschaulicht die Funktion eines Stromspiegels mit pnp-Transistoren.\n\nMan sieht:\n",B.IF,"Englisch",B.V,null)
B.J7=A.a(s(["Vor dem Zusammenf\xfchren der beiden Halbleiter sind diese elektrisch neutral, da jedem freien Elektron (-) im n-Gebiet ein ortsfestes, positiv ionisiertes Donatoratom ND+ (nicht eingezeichnet) gegen\xfcbersteht. Umgekehrt wird die L\xf6cherladung im p-Typ Halbleiter von den ionisierten Akzeptoratomen NA- kompensiert.","Nach dem Zusammenf\xfchren entsteht wegen der gro\xdfen Konzentrationsgradienten an dem \xdcbergang zun\xe4chst eine Diffusionsbewegung der Ladungstr\xe4ger, d.h. L\xf6cher (+) diffundieren vom p-Gebiet in das n-Gebiet und Elektronen (-) vom n-Gebiet in das p-Gebiet. Dadurch entsteht jedoch ein Ladungsungleichgewicht und somit ein elektrisches Feld E, welches seinerseits eine Driftbewegung hervorruft, die der Diffusionsbewegung entgegengerichtet ist.","Nach kurzer Zeit stellt sich ein Gleichgewicht zwischen dem Diffusionsvorgang und der Driftbewegung ein."]),t.s)
B.Ay=new A.Gu(null)
B.JE=A.a(s(["Wird von au\xdfen eine elektrische Spannung Upn>0 an die Diode angelegt, so verringert sich die effektive, \xfcber dem pn-\xdcbergang liegende Spannung und damit auch das elektrische Feld E. Als Folge davon \xfcberwiegt nun die Diffusionsbewegung; Elektronen werden verst\xe4rkt ins p-Gebiet und L\xf6cher verst\xe4rkt in das n-Gebiet injiziert. Wegen der Neutralit\xe4t au\xdferhalb der RLZ m\xfcssen im gleichen Ma\xdfe die Majorit\xe4tstr\xe4gerdichten (L\xf6cher im p-Halbleiter, Elektronen im n-Halbleiter) ansteigen, so dass beide Ladungstr\xe4gerarten au\xdferhalb der RLZ oberhalb ihrer Gleichgewichtsdichten liegen. Dies f\xfchrt zur Rekombination der Ladungstr\xe4ger. So rekombinieren z.B. die in das p-Gebiet injizierten Elektronen mit den dort befindlichen L\xf6chern. Es m\xfcssen daher st\xe4ndig Majorit\xe4tstr\xe4ger aus den neutralen Gebieten nachgeliefert werden, was einem elektrischen Strom entspricht. Der Strom ist um so gr\xf6\xdfer, je mehr Ladungstr\xe4ger in die neutralen Gebiete injiziert werden, d.h. je h\xf6her die Konzentration der Ladungstr\xe4ger an den R\xe4ndern Xp und Xn der RLZ ist. Diese Konzentration h\xe4ngt exponentiell von der Spannung am pn-\xdcbergang und damit von der von au\xdfen angelegten Spannung Upn ab. Der Strom I durch die Diode steigt daher exponentiell mit der Spannung Upn, was sich in der steil ansteigenden I-U-Kennlinie f\xfcr U>0 zeigt.","F\xfcr Spannungen Upn < 0 wird die effektive Spannung und damit die Feldst\xe4rke E am pn-\xdcbergang erh\xf6ht. Dadurch \xfcberwiegt nun die Driftbewegung gegen\xfcber dem Diffusionsvorgang und die Ladungstr\xe4gerdichten an den Stellen Xn und Xp sinken auf sehr kleine Werte ab. Es gelangen somit auch nur noch sehr wenige Ladungstr\xe4ger durch die RLZ in das jeweils benachbarte Gebiet. Diese wenigen Ladungstr\xe4ger liefern den so genannten Sperrstrom, der sehr klein ist und der auch f\xfcr gro\xdfe negative Spannungen kaum noch w\xe4chst. Die I-U-Kennlinie zeigt daher f\xfcr negative Spannungen kaum noch eine \xc4nderung des Stromes I.","Da sich mit der von au\xdfen angelegten Spannung Upn auch die Spannung am pn-\xdcbergang - d.h. \xfcber der RLZ - \xe4ndert, ver\xe4ndert sich damit auch die Weite der gesamten Raumladungszone. Insbesondere w\xe4chst diese, wenn die Sperrspannung Upn < 0 weiter zu negativen Werten hin erh\xf6ht wird. Die Spannung \xfcber der RLZ - die der Fl\xe4che unter dem Dreieck E(X) entspricht - ist dabei gleich der Diffusionsspannung abz\xfcglich der Spannung Upn."]),t.s)
B.Az=new A.c2("Dieses Applet veranschaulicht die Funktionsweise der Diode, indem eine Spannung Upn von au\xdfen an einen pn-\xdcbergang gelegt wird. Nach Vorgabe der Spannung Upn wird der Strom I durch die Diode berechnet. Dar\xfcber hinaus werden die Verteilungen der Ladungstr\xe4ger (Elektronen und L\xf6cher) im p- und n-Gebiet sowie das elektrische Feld E bestimmt und grafisch dargestellt.\n\nMan sieht:\n",B.JE,"Englisch",B.V,null)
B.KG=A.a(s(["Werden Metall und Halbleiter in Kontakt gebracht, so muss im thermodynamischen Gleichgewicht das Ferminiveau Wf in beiden Materialien auf einer H\xf6he verlaufen. Entsprechend m\xfcssen daher die beiden B\xe4nderdiagramme vertikal gegeneinander verschoben werden, was zu einer Verbiegung der B\xe4nder im Bereich des \xdcbergangs f\xfchrt.","Fall 1: Schottky-Kontakt\nBei einem n-Typ-Halbleiter ergibt sich durch die Verbiegung der B\xe4nder eine Spitze in der Leitungsbandkante Wc, die f\xfcr Elektronen eine Potentialbarriere darstellt, welche nicht ohne Weiteres \xfcberwunden werden kann. Bei einem p-Typ-Halbleiter hingegen ergibt sich eine Potentialbarriere in der Valenzbandkante Wv, die von L\xf6chern nicht ohne Weiteres \xfcberwunden werden kann.","Fall 2: Ohmscher Kontakt\nDie Bandverbiegung im Bereich des \xdcbergangs f\xfchrt nicht zu einer Potentialbarriere, d.h. die Ladungstr\xe4ger k\xf6nnen ungehindert von einem Gebiet in das andere gelangen; der Strom wird nur durch den ohmschen Widerstand der neutralen Bahngebiete bestimmt."]),t.s)
B.AA=new A.c2('In diesem Applet wird die Konstruktion des B\xe4nderdiagramms eines Metall-Halbleiter-Kontaktes animiert dargestellt. Dabei kann ausgew\xe4hlt werden, ob der entstehende Kontakt ein dioden\xe4hnliches Verhalten (Schottky) oder aber ein ohmsches Verhalten (ohmic) aufweisen soll. Weiterhin kann die Dotierung des Halbleiters (n-type oder p-type) festgelegt werden. Bei einem n-Halbleiter werden die Eigenschaften des Kontaktes durch das Verhalten der Elektronen bestimmt, die sich entlang der Leitungsbandkante Wc bewegen. Bei einem p-Halbleiter hingegen bestimmen die sich entlang der Valenzbandkante Wv bewegenden L\xf6cher die Eigenschaften des Kontaktes. Zun\xe4chst werden die B\xe4nderdiagramme f\xfcr das Metall und f\xfcr den Halbleiter getrennt dargestellt. Das Vakuumniveau Wo dient dabei als gemeinsames Bezugsniveau. Nach Bet\xe4tigung der Schaltfl\xe4che "Start" werden die beiden Materialien miteinander in Kontakt gebracht. Im oberen Panel des Applets werden die Verl\xe4ufe der Energieb\xe4nder dargestellt. Das untere Panel zeigt die zugeh\xf6rige Verteilung der Ladungsdichte .\n\nMan sieht:\n',B.KG,"Englisch",B.V,null)
B.KZ=A.a(s(["Durch die unterschiedlichen Lagen der Bandkanten Wv und Wc relativ zum Ferminiveau bei unterschiedlichen Dotierungen (vgl.: Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm), stellt das Bulk-Gebiet (p-dotiert) eine Potenzialbarriere dar, die Elektronen \xfcberwinden m\xfcssen, wenn sie sich von der n-dotierten Source zu der n-dotierten Drain bewegen.","Erh\xf6ht man bei UGS=0 das Potenzial an der Drain-Elektrode (UDS>0), verschieben sich dort das Ferminiveau und demzufolge auch die Bandkanten Wc und Wv entsprechend nach unten, die Elektronen k\xf6nnen aber die nach wie vor existierende Potentialbarriere zwischen Source und Drain nicht \xfcberwinden, so dass kein Strom flie\xdft.","Erh\xf6ht man das Potenzial an der Gate-Elektrode, bleibt das Ferminiveau im Bulk zwar auf unver\xe4ndertem Niveau, die Bandkanten Wc und Wv verschieben sich jedoch im Bereich des Gates relativ zum Ferminiveau nach unten (siehe auch: B\xe4nderdiagramm einer MOS-Struktur) und die Potenzialbarriere zwischen Source und Drain verringert sich. Bei hinreichend gro\xdfer Gatespannung (UGS>Uth) kann demnach ein Strom zwischen Source und Drain flie\xdfen, sofern eine Spannung UDS anliegt.","Ein Erh\xf6hen des Bulk-Potenzials (USB<0) verschiebt hingegen das Ferminiveau im Bereich des Bulks nach oben und damit auch die Potenzialbarriere. Unter sonst gleichen Bedingungen muss also jetzt eine h\xf6here Gatespannung UGS angelegt werden, um einen Stromfluss zwischen Source und Drain zu erhalten. Diesen Effekt bezeichnet man auch als Substratsteuereffekt."]),t.s)
B.AB=new A.c2("Das folgende Applet stellt die Funktionsweise des MOSFET mit Hilfe des B\xe4nderdiagramms dar. Gate-, Drain- und Bulk-Potenzial k\xf6nnen dabei von dem Nutzer jeweils gegen\xfcber dem Source-Potenzial (Bezugspotenzial) ge\xe4ndert werden.\n\nMan sieht:\n",B.KZ,"Englisch",B.V,null)
B.KW=A.a(s(["Bei der Spannung UGB=0V liegen die Ferminiveaus des Metalls und des Halbleiters auf gleicher H\xf6he. Die B\xe4nder verlaufen horizontal.","Bei negativen Spannungen (UGB<0V) verschieben sich die Ferminiveaus gem\xe4\xdf U=-W/q und es tritt eine Verbiegung der B\xe4nder sowohl im Isolator als auch im Halbleiter auf. Der gr\xf6\xdfer werdende Abstand zwischen Ferminiveau Wf und Intrinsicniveau Wi entspricht einer Zunahme der L\xf6cherdichte und einer Abnahme der Elektronendichte in der N\xe4he der Grenzfl\xe4che Oxid-Halbleiter (vgl. Darstellung der Tr\xe4gerdichten abh\xe4ngig von der Lage des Ferminiveaus). Diesen Fall der Anh\xe4ufung von Majorit\xe4tstr\xe4gern an der Grenzfl\xe4che Oxid-Halbleiter nennt man Akkumulation.","Bei kleinen positiven Spannungen (UGB>0V) verbiegen sich die B\xe4nder entsprechend in die andere Richtung, so dass nun eine Abnahme der L\xf6cherdichte und eine Zunahme der Elektronendichte in der N\xe4he der Grenzfl\xe4che Oxid-Halbleiter auftritt. Durch das Ausr\xe4umen der L\xf6cher entsteht eine Raumladungszone in dem Bereich 0<x<xd. Diesen Fall nennt man Verarmung.","Ab einer bestimmten positiven Spannung (hier: UGB=0,8V) ist die Elektronendichte an der Grenzfl\xe4che so gro\xdf wie die L\xf6cherdichte des p-Halbleiters sehr weit von der Grenzfl\xe4che entfernt. Diesen Zustand des Halbleiters nennt man Inversion. Die Spannung, bei der die Inversion einsetzt, ist die so genannte Einsatzspannung.","F\xfcr noch gr\xf6\xdfere Spannungen oberhalb der Einsatzspannung (hier: UGB>0,8V) nimmt die Elektronendichte an der Grenzschicht Oxid-Halbleiter immer weiter zu, die B\xe4nder des Halbleiters verbiegen sich wegen der exponentiellen Abh\xe4ngigkeit zwischen Spannung und Ladungstr\xe4gerdichte aber kaum noch. Das hei\xdft, dass auch die Weite xd der Raumladungszone von nun ab n\xe4herungsweise konstant bleibt."]),t.s)
B.AC=new A.c2("Dieses Applet verdeutlicht die physikalischen Vorg\xe4nge in der MOS-Struktur nochmals anhand einer vereinfachten B\xe4nderdiagrammdarstellung. Gezeigt wird das Verhalten einer MOS-Struktur abh\xe4ngig von der angelegten Spannung.\n\nMan sieht:\n",B.KW,"Englisch",B.V,null)
B.JI=A.a(s(["Ist der Abstand zwischen den beiden Atomen hinreichend gro\xdf, so stehen diese nicht miteinander in Wechselwirkung. Die m\xf6glichen Energiewerte, die die beiden Atome annehmen k\xf6nnen, liegen auf der gleichen H\xf6he wie bei einem einzelnen Atom.","Bringt man die beiden Atome n\xe4her zusammen, so \xfcberlappen sich die Elektronenbahnen und beide Atome treten miteinander in Wechselwirkung. Dies bewirkt - \xe4hnlich wie bei gekoppelten Resonatoren - eine Aufspaltung der m\xf6glichen Energieniveaus, die um so st\xe4rker ist, je gr\xf6\xdfer die Kopplung, d.h. je geringer der Abstand zwischen den beiden Atomen ist."]),t.s)
B.AD=new A.c2("Das Applet zeigt die Auswirkungen auf die m\xf6glichen Energiezust\xe4nde W zweier einzelner Atome, wenn diese miteinander in Wechselwirkung gebracht werden, indem man den Abstand zwischen ihnen verringert.\n\nMan sieht:\n",B.JI,"Englisch",B.V,null)
B.IN=A.a(s(["F\xfcr UBE=0V und UCE=5V ist sowohl der Basis-Kollektor \xdcbergang als auch der Basis-Emitter \xdcbergang in Sperrrichtung gepolt, so dass kein Strom durch den Transistor flie\xdft, d.h. IE=IC=0.","Erh\xf6ht man die Basis-Emitter Spannung auf etwa UBE=0,7V, so wird der Basis-Emitter \xdcbergang in Durchlassrichtung gepolt. Dies f\xfchrt (vgl. Diode) zum einen dazu, dass L\xf6cher vom p-Gebiet (der Basis) in das n-Gebiet (den Emitter) diffundieren und dort rekombinieren. Zum anderen diffundieren Elektronen umgekehrt von dem n-Gebiet in die Basis. Da die Basisweite jedoch sehr klein ist, rekombinieren die Elektronen dort nicht, sondern gelangen bis in den n-dotierten Kollektor. Die angelegte Basis-Emitter Spannung f\xfchrt somit zu einem Elektronenstrom vom Emitter durch das Basisgebiet bis hin zum Kollektor."]),t.s)
B.AE=new A.c2("Dieses Applet veranschaulicht die Funktion des Bipolartransistors.\n\nMan sieht:\n",B.IN,"Englisch",B.V,null)
B.IM=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Phosphor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (f\xfcnfwertige) P-Atome, so gehen jeweils vier der f\xfcnf Elektronen des Phosphor-Atoms (P) eine Bindung mit den benachbarten Si-Atomen ein; das f\xfcnfte Elektron bleibt jedoch ungebunden.",'Dieses f\xfcnfte Elektron, das keine Bindung eingegangen ist, kann bereits durch Zuf\xfchren geringer Ionisierungsenergie (z.B. geringe Temperaturerh\xf6hung) von dem Phosphor-Atom (P), dem so genannten Donator, gel\xf6st werden und wird dann zu einem "freien" Elektron. In dem B\xe4nderdiagramm entspricht diese geringe Ionisierungsenergie dem geringen Abstand des Donatorniveaus Wd zum Leitungsband Wc.',"Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (150K) alle Phosphoratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien Elektronen no gleich der Dichte ND der Dotierungsatome ist.","Der positive Atomrumpf (P+) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Durch das Dotieren erh\xf6ht sich demnach nur die Anzahl der freien Elektronen, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Wird die Temperatur weiter erh\xf6ht (T>300K) l\xf6sen sich - wie auch beim undotierten Halbleiter - immer mehr Bindungen zwischen den Si-Atomen und es entstehen zus\xe4tzliche Elektronen-Loch-Paare.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes, ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Phosphor dotierten Halbleiter die freien Elektronen ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem n-Typ Halbleiter."]),t.s)
B.AF=new A.c2("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Phosphor) die Anzahl der zum Stromtransport wichtigen freien Elektronen erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.IM,"Englisch",B.V,null)
